/**
 * Created by Lenovo on 2019/9/2.
 */
import React from 'react';
import './message.css';
import avatar from '../../images/personal/avatar.jpg';
import sale from '../../images/personal/sale.png';
import buy from '../../images/personal/buy.png';
import modify from '../../images/personal/modify.png';
import {Title} from '../../share';
import {getData, goNext} from '../../utils';
export default class MessageDetail extends React.Component {
    constructor(props) {
        super(props);
        this.item = this.props.history.location.state ||{};
    }
    componentDidMount(){
        this.goLogin();
    }
    goDetail() {
        goNext(this, 'messageDetail',this.state.info);
    }
    goLogin(){
        getData({
            method: 'post',
            url: 'getChatList',
            data: {},
            successCB: (res) => {
                console.log(res);
            }
        })
    }
    render() {
        return <div>
            <Title title={this.item.anotherUserName} />
            <div className="cm-mlr-10">
               <div className="cm-flex cm-ai-c">
                   <img src={this.item.anotherUserAvatar} alt=""/>
                   <div>
                       <div className="cm-c-main">￥123</div>
                       <div>交易前聊一聊</div>
                   </div>
               </div>
            </div>
        </div>
    }
}
